// storing route separately so as to not clutter other JS files

mapboxgl.accessToken = 'pk.xxxxxxxxx';  // insert mapbox access token here
var map = new mapboxgl.Map({
    container: 'map',
    style: 'mapbox://styles/mapbox/outdoors-v11',
    center: [15, 48],
    zoom: 3 // zoom range is 0 (the whole world) to 22 (street level)
});

var distanceContainer = document.getElementById('distance');
    
// GeoJSON object to hold our measurement features
var geojson = {
    'type': 'FeatureCollection',
    'features': []
};
var finishPoint = {
    'type': 'FeatureCollection',
    'features': []
};
var progressLine = {
    'type': 'FeatureCollection',
    'features': []
};

map.on('load', function () {
    var routeLineString = getRoute();

    var line = routeLineString;
    
    var options = {units: 'kilometers'};
    var endPoint = turf.along(line, turf.length(line), options);

    map.addSource('route-source', {
        'type': 'geojson',
        'data': line
    });

    // Add styles to the map. Style layer: A style layer ties together the source and image and specifies how they are displayed on the map.
    // 'line-color': '#0C7CBB', // dark cyan
    // NHS blue: 005EB8
    map.addLayer({
        'id': 'route',
        'type': 'line',
        'source': 'route-source',
        'layout': {
            'line-join': 'round',
            'line-cap': 'round'
        },
        'paint': {
            'line-color': '#0C7CBB',
            'line-width': 7
        }
    },'routeProgress');  // placement of this line below the progress line layer
    
    // destination marker
    map.loadImage("https://i.imgur.com/MK4NUzI.png", function (error, image) {
        if (error) throw error;
        map.addImage("finish-flag", image);
        map.addSource('finish-source', {
            'type': 'geojson',
            'data': finishPoint
        }); 
        map.addLayer({
            id: 'finish',
            type: 'symbol',
            source: 'finish-source',
            layout: {
                "icon-image": "finish-flag",
                'icon-anchor': "bottom"
            }
        });
    }); 
    
    finishPoint.features.push(endPoint);
    //map.getSource('geojson').setData(geojson);
    
});

$(document).ready(function() {
    // Clear the Distance container to populate it with a new value
    distanceContainer.innerHTML = '';

    var line = getRoute();
    var options = {units: 'kilometers'};


    // AJAX request to get progress
    $.ajax({    //create an ajax request to getTotalProgress.php
        type: "GET",
        url: "./php/getTotalProgress.php",             
        dataType: "json",   //expect json to be returned
        data: {
            //access_key: access_key, 
        },                
        success: function(response){
            //alert(response.totaldist);
            var distStart = 0;
            var distAlongRoute = response.totaldist;

            var along = turf.along(line, distAlongRoute, options);

            if (response.totaldist<0.1) {
                distAlongRoute = 0.1; // prevent error in lineSliceAlong if dist = 0
            }
            var sliceLine = turf.lineSliceAlong(line, distStart, distAlongRoute, {units: 'kilometers'});

            map.addSource('progress-source', {
                'type': 'geojson',
                'data': sliceLine
            });
            map.addLayer({
                'id': 'routeProgress',
                'type': 'line',
                'source': 'progress-source',
                'layout': {
                    'line-join': 'round',
                    'line-cap': 'round'
                },
                'paint': {
                    'line-color': '#d42202',
                    'line-width': 8
                }
            });

            // Progress marker
            // Image: An image is loaded and added to the map.
            map.loadImage("https://img.icons8.com/color/48/000000/marker.png", function (error, image) {
                if (error) throw error;
                map.addImage("custom-marker", image);
                map.addSource('geojson', {
                    'type': 'geojson',
                    'data': geojson
                });
                map.addLayer({
                    id: 'progress',
                    type: 'symbol',
                    source: 'geojson',
                    layout: {
                        "icon-image": "custom-marker",
                        'icon-anchor': "bottom"
                    }
                });
            });

            geojson.features.push(along);
            progressLine.features.push(sliceLine);

            // Populate the distanceContainer with total distance
            var value = document.createElement('pre');
            value.textContent =
            'Progress: ' +
            response.totaldist.toLocaleString() + 
            'km';
            /* with total included (the "X/5,200km" bit)
            var value = document.createElement('pre');
            value.textContent =
            'Progress: ' +
            response.totaldist + '/' +
            Math.round(turf.length(line)).toLocaleString() +
            'km';
            */
            distanceContainer.appendChild(value);
            // var length = turf.length(line, {units: 'miles'});
        }
    });
});

